import Card from './Card';
import styles from './Cards.module.css';

export default function Cards(props) {
   const { characters } = props;
   return(
		  <div className={styles.divCards}>
			{characters.map(c => 
			<Card key={c.name}
				name={c.name}
				species={c.species}
				gender={c.gender}
				image={c.image}	
				onClose={props.onClose}
			/>)}
		  </div>
   )
}
